        <p><strong>#করোনার_সময়_ক্লাস_নয়</strong> ইভেন্টে প্ল্যাকার্ড হাতে নিজের ছবি পোষ্ট করুন এবং আমাদের পাশে এসে দাঁড়ান।  </p>
      </header>
    </div>
  );
}

export default App;
